nt-weight:undefined;fill:rgb(54,21,44);;text-anchor:middle">Ici vous pouvez déguster les nouilles sous</text><text x="467.7333333333333" y="1190" style="font-family:chivo;font-size:40;font-weight:undefined;fill:rgb(54,21,44);;text-anchor:middle">toutes les formes: en soupe, à la poële ou</text><text x="467.7333333333333" y="1230" style="font-family:chivo;font-size:40;font-weight:undefined;fill:rgb(54,21,44);;text-anchor:middle">bouillies</text><text x="467.7333333333333" y="1320" style="font-family:chivo;font-size:40;font-weight:undefined;fill:rgb(54,21,44);;text-anchor:middle">Prenez le temps de faire votre choix. N'hésitez</text><text x="467.7333333333333" y="1360" style="font-family:chivo;font-size:40;font-weight:undefined;fill:rgb(54,21,44);;text-anchor:middle">pas à nous poser des questions. Si vous êtes</text><text x="467.7333333333333" y="1400" style="font-family:chivo;font-size:40;font-weight:undefined;fill:rgb(54,21,44);;text-anchor:middle">allergique, faites nous le savoir, nous nous</text><text x="467.7333333333333" y="1440" style="font-family:chivo;font-size:40;font-weight:undefined;fill:rgb(54,21,44);;text-anchor:middle">efforcerons de vous proposer une</text><text x="467.7333333333333" y="1480" style="font-family:chivo;font-size:40;font-weight:undefined;fill:rgb(54,21,44);;text-anchor:middle">alternative.</text><g id="logo" transform="translate(210,210) scale(1)"><g transform="translate(0,436)"><path id="logo-0" d="m 495.25649,-184.90374 c 0,135.488272 -109.83596,245.324219 -245.32424,245.324219 -135.48825,0 -245.3242108,-109.835947 -245.3242108,-245.324219 0,-135.48826 109.8359608,-245.32422 245.3242108,-245.32422 135.48828,0 245.32424,109.83596 245.32424,245.32422"  style="fill:rgb(54,21,44)"></path><path id="logo-1" d="M 68.349609 173.93359 L 68.349609 260.68945 L 79.193359 260.68945 L 79.193359 195.29688 L 117.04102 260.68945 L 127.88477 260.68945 L 127.88477 173.93359 L 117.04102 173.93359 L 117.04102 238.89062 L 79.410156 173.93359 L 68.349609 17
